import Button from "./Button"

const NavBar = () => {
    return (
        <div className='navbar'>
            <Button text='About' activeClass="active" smooth spy to="body"/>
            <Button text='Experience'/>
            <Button text='Contact'/>
        </div>
    )
}

export default NavBar
